import React, { useEffect, useState } from 'react'
import axios from 'axios'

function Laptops() {

    const [data, setData] = useState()
    useEffect(
        () =>
            axios.get("http://localhost:3003/data")
                .then((res) => {
                    setData(res.data);
                    // console.log(res.data);
                })
                .catch((err) => {
                      console.log(err);

                }), []
    );

    

    return (
        <div>
            <h2>Laptops</h2>
        </div>
    )
}

export default Laptops
